package foundation.icon.btp.bmv.eth2.cases;

import foundation.icon.btp.bmv.eth2.score.BMVScore;
import foundation.icon.icx.IconService;
import foundation.icon.icx.KeyWallet;
import foundation.icon.icx.transport.http.HttpProvider;
import foundation.icon.score.util.StringUtil;
import foundation.icon.test.*;
import okhttp3.OkHttpClient;
import org.junit.jupiter.api.*;
import score.Address;

import java.math.BigInteger;


@Tag("integration")
@TestMethodOrder(MethodOrderer.OrderAnnotation.class)
public class BTPMessageVerifierScoreTest extends TestBase {
    private static TransactionHandler txHandler;
    private static KeyWallet ownerWallet;
    private static BMVScore bmvScore;

    @BeforeAll
    static void setup() throws Exception {
        Env.Chain chain = Env.getDefaultChain();
        OkHttpClient ohc = new OkHttpClient.Builder().build();
        IconService iconService = new IconService(new HttpProvider(ohc, chain.getEndpointURL(3)));
        txHandler = new TransactionHandler(iconService, chain);

        // init wallets
        BigInteger amount = ICX.multiply(BigInteger.valueOf(3000));
        ownerWallet = KeyWallet.create();
        txHandler.transfer(ownerWallet.getAddress(), amount);
        ensureIcxBalance(txHandler, ownerWallet.getAddress(), BigInteger.ZERO, amount);
    }

    @Test
    void hashTree() throws Exception {
        bmvScore = BMVScore.mustDeploy(
                txHandler,
                ownerWallet,
                "btp://0x1.asdf",
                StringUtil.hexToBytes("4b363db94e286120d76eb905340fdd4e54bfe9f06bf33ff6cf5ad27f511bfe95"),
                StringUtil.hexToBytes(""),
                Address.fromString("cx1234123412341234123412341234123412341234"),
                StringUtil.hexToBytes("f6e8530000000000c29f06000000000064c6737346366a65b7a12887a5be9c05686e043072155f55ab8c431aea707a0825c8066c8e0ebe6afaa9ff17674f3c05f6f7a69496088869ef4d2787bf7d162fffa4807bb738febe805d78596533b6f905d9435a924d43bbea5c8f551bea13a0"),
                StringUtil.hexToBytes("1234123412341234123412341234123412341234")
        );
    }
}
